import { StyleSheet} from 'react-native';

const stylesLogin = StyleSheet.create({
    login:{
        backgroundColor: '#080909',
        width: '100%',
        height: '100%'
    },
    textinputUser:{
        borderColor: 'grey',
        borderWidth: 1,
        marginTop: '10%'
    },
    textinputPassword:{
        borderColor: 'grey',
        borderWidth: 1,
        marginTop: '7%'
    }
});

export default stylesLogin;
